INSERT INTO `wp_posts` VALUES (80,1,'2014-07-30 11:54:50','2014-07-30 11:54:50','Artist Development Coordinator Soundhouse Promotions, Inc\r\n\r\nMichael Britton; Artist Development coordinator, Michael is an Entertainer/Singer/Guitarist/Bassist/Percussionist/Studio Musician/ASCAP Songwriter and Publisher/Recording Engineer/Producer/Film Maker, He brings so much talent to the soundhouse team for the development of our pool of artists, he also began playing guitar at age 9, cut his first single at age 12, professional musician since 19. Began recording at Wally Heider\'s Hollywood in the early 70\'s, grew up in Pasadena, CA and shared stages with Van Halen, and had a band with pre crue drummer Tommy Lee. Screen Gems EMI, Ira Jaffe picked up Britton and published him by 1978, then the 80\'s exposed Britton as a national heavy metal band on the same playlists as Aerosmyth, Bon Jovi, and the like. Britton has a catalog of songs he licenses to commercial interests, performs, writes and records in many genres. He has an ear for radio play songs, is a master songwriter and hook monster. He understands the music craft and business in it\'s totality.\r\n\r\n<p class=\"email-link\">Email me: mbritton@soundhousepromotions.com</p>','Michael Britton','','publish','closed','closed','','michael-britton','','','2014-10-16 07:23:49','2014-10-16 07:23:49','',0,'http://csdevhub.com/dev002/Soundhouse/?post_type=soundhouse-members&#038;p=80',3,'soundhouse-members','',0);
