INSERT INTO `wp_posts` VALUES (84,1,'2014-07-30 12:36:19','2014-07-30 12:36:19','VP Sales / Marketing Soundhouse Promotions, Inc\r\n\r\nKory, hailing from Memphis Tn, joins the Sound House team after 16 years of successfully managing sales and marketing forces for broadcast media giants Entercom Communications and CBS Broadcasting. He brings his talents and drive to the Sound House team with a clear focus on artist integration and company brand awareness. A consummate musician, he still today produces and performs regularly with musical groups in and around the Memphis area. Thru the years Kory has had the pleasure of performing with several marquee entertainers such as the legendary blues man Don Nix and Jimi Jamisons Survivor. Today his focus is dedicated to musical artists and unveiling them to the world thru Sound House!\r\n\r\nEmail me: kory@soundhousepromotions.com','Kory Myers','','publish','closed','closed','','kory-myers','','','2014-10-16 22:19:31','2014-10-16 22:19:31','',0,'http://csdevhub.com/dev002/Soundhouse/?post_type=soundhouse-members&#038;p=84',2,'soundhouse-members','',0);
