INSERT INTO `wp_posts` VALUES (86,1,'2014-07-30 12:37:24','2014-07-30 12:37:24','President &amp; Co-Founder Soundhouse Promotions, Inc.\r\n\r\nRichard is the mastermind behind Soundhouse Promotions Sales and Marketing (ESM). As he will tell you, there are many marketing and sales \"professionals\" out there that someone can hire  but very few who have the skills, creativity, and integrity also needed to truly help organizations with their marketing, sales, and business development efforts.\r\n\r\nNot only is Richard a very bright, energetic and passionate sales guy, he has extensive corporate and entrepreneurial experience. His experience spans a wide variety of industries. Richard has lent his talents to companies such as Honda and Toyota Motor of America in upper executive positions in the sales, marketing, and business development sectors. Richard has achieved tremendous successes throughout his extensive professional career, and is responsible for growing business large and small. Richard prides himself in real selling techniques, to ensure his clients monitor and maintain profitability.\r\n\r\nRich\'s vast professional expertise has helped to launch a number of exciting new products and companies, building them from the ground up, such as Savanna Inc, a soon-to-be launched company Rich created.\r\n\r\nRichard has over 20years of marketing experience with organizations. He has managed strategic and tactical marketing, perfecting the art of online campaigns.\r\n\r\nRich hails from New York and lives in California now and where he\'s earnedhis degrees in Sales And Marketing &amp;Business Administration . Rich also enjoys spending time traveling, relaxing at his home and being with his family.\r\n<p class=\"email-link\">Email me: rich@soundhousepromotions.com</p>','Richard Bertuglia','','publish','closed','closed','','richard-bertuglia-2','','','2014-11-06 22:59:42','2014-11-06 22:59:42','',0,'http://csdevhub.com/dev002/Soundhouse/?post_type=soundhouse-members&#038;p=86',1,'soundhouse-members','',0);
INSERT INTO `wp_posts` VALUES (87,1,'2014-07-30 12:37:57','2014-07-30 12:37:57','CEO and Co-Founder Soundhouse Promotions, Inc.\r\n\r\nSteve brings to Soundhouse a wealth of musical knowledge spanning 50 years as a musician, teacher and lecturer. He is well versed in music creation, song writing and production. He has played guitar and studied under the world renowned jazz artist George Benson and Joe Monk.\r\n\r\nHis families musical ties stretches back 2 generations, with Steve\'s father, an accomplished jazz guitar player, teaching Steve to play starting at 7 years old.\r\n\r\nSteve has more than 30 years of aviation experience as a chief pilot and trainer for FedEx and also has progressively responsible experience in directing training and managing over 100 employees at FedEx with with his annual budget in excess of $75 million. Steve has led in a variety of industries, including consumer durables, Steve\'s been a Successful entrepreneur and consultant for the tech start up \"Genelink.\" NASDAQ. His understanding of both domestic and international distribution channels encompasses retail sales, wholesale.\r\n\r\nHe is active in a variety of civic and cultural organizations and is active with st Jude\'s children hospital for cancer,Outside of professional interests,he travels widely, reads, writes, and enjoys living in sunny California with his family.\r\n\r\n<p class=\"email-link\">Email me: steve@soundhousepromotions.com</p>','Steven A Arena','','publish','closed','closed','','steven-a-arena','','','2014-10-16 07:21:38','2014-10-16 07:21:38','',0,'http://csdevhub.com/dev002/Soundhouse/?post_type=soundhouse-members&#038;p=87',0,'soundhouse-members','',0);
