INSERT INTO `wp_usermeta` VALUES (1266,39,'wp_s2member_custom_fields','a:5:{s:9:\"user_city\";s:11:\"Los Angeles\";s:10:\"user_state\";s:10:\"California\";s:8:\"user_zip\";s:5:\"90009\";s:12:\"facebook_url\";s:37:\"https://www.facebook.com/msbangbangla\";s:14:\"user_biography\";s:895:\"Bang Bang, formerly known as \"Germfree,\" is an experimental rap & rocknroll artist currently working as Bang Bang to create a new sound for her upcoming album. As Germfree, she featured on six seasons of The Cypher Effect, and gaining popularity through the EDM world as many of her songs were picked up and remixed by various artists including: Kennedy Jonez, Schoolboy Q, Messinian, among others. Bang Bang also gained underground success as a ghostwriter for numerous popular hip-hop artists. \r\n\r\nAs Bang Bang, she has taken her gritty urban sound and funneled it in to a new sound infusing rocknroll and a legendary producer, Big Chris Flores. Bang Bang assisted by Troy Duffy, has a new music video on its way featuring Slash, due out later this year. Her success as a female rapper is rocketing her to new horizons that will be everywhere to hear and see later this year.\";}');
